import React, { useState, useEffect } from 'react';
import { Table, Button } from 'react-bootstrap';
import axios from 'axios';
import { Link } from 'react-router-dom';

const ReadOrderDetails = () => {
  const [orders, setOrders] = useState([]);

  //save data in list
  const getOrders = async () => {
    const result = await axios.get('http://localhost:8080/getemployee')
    console.log(result.data);   //data is array added object
    setOrders(result.data);
  };

  useEffect(() => { // useEffect use to rerander only when change in getdata function
    getOrders();
  }, []);

  return (
    <div>
      <h1>Order Details</h1>
      <div className="d-flex justify-content-between m-3">
        <Link to="">
          <Button variant="secondary">place order</Button>
        </Link>
      </div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>displayOrderId</th>
            <th>customerName </th>
            <th>productName</th>
            <th>mobileNo</th>
            <th>modelNo</th>
            <th>brandName</th>
            <th>ProductColor </th>
            <th>category</th>
            <th>subCategory</th>
            <th>discription</th>
            <th>orderDate </th>
            <th>expectedDeliveryDate</th>
            <th>logisticName</th>
            <th>awbNo</th>
            <th>couponCode </th>
          </tr>
        </thead>
        <tbody >
          {
            orders.map((orders) => {
              return (
                  <tr>
                    <td>{orders.displayOrderId}</td>
                    <td>{orders.customerName}</td>
                    <td>{orders.productName}</td>
                    <td>{orders.mobileNo}</td>
                    <td>{orders.modelNo}</td>
                    <td>{orders.brandName}</td>
                    <td>{orders.ProductColor}</td>
                    <td>{orders.category}</td>
                    <td>{orders.subCategory}</td>
                    <td>{orders.discription}</td>
                    <td>{orders.orderDate}</td>
                    <td>{orders.expectedDeliveryDate}</td>
                    <td>{orders.logisticName}</td>
                    <td>{orders.awbNo}</td>
                    <td>{orders.couponCode}</td>
                    <td>
                      <Button className="btn btn-primary mx=3">view</Button>
                      <Button variant="danger mx=3">Delete</Button>
                    </td>
                  </tr>
                )})
          }
        </tbody>
      </Table>
    </div>
  );
}

export default ReadOrderDetails
